 Deep Freeze is the standard in bulletproof disk protection

Deep Freeze instantly protects and preserves baseline computer configurations. No matter what changes a user makes to a workstation, simply restart to eradicate all changes and reset the computer to its original state - right down to the last byte. Expensive computer assets are kept running at 100% capacity and technical support time is reduced or eliminated completely. The result is consistent trouble-free computing on a truly protected and parallel network, completely free of harmful viruses and unwanted programs.

While Deep Freeze provides bulletproof protection, its non-restrictive approach also improves user productivity and satisfaction. Placing no restrictions on a user&amp;#039;s ability to access all system resources, users avoid the frustration of downtime due to software conflicts, operating system corruption, virus attacks, and many other problems. Users are always assured of computers that are consistently operable and available.

Deep Freeze is currently available in two editions for Windows, each with different features and capabilities to suit the needs of any environment... Mac OS X and Windows Server editions are available and we are currently gathering market interest in a Linux edition.

Deep Freeze Standard is changing the way IT Professionals protect small multi-user environments. Simple, robust, and cost effective Deep Freeze Standard is ideal for computing environments with 10 or less workstations
